//import './style.css';
import React from 'react';
import * as d3 from 'd3';

class Tuto extends React.Component {
    constructor(props) {
        super(props);
        this.map = {};
        this.state = { data: {} }
    }
    
    componentDidMount() {
        var svg = d3.select("#svg1").append("svg");
        svg = d3.select("#svg2").append("svg");
        var group = svg.append("g");
        for (var i = 0; i < 3; ++i) {
            group.append("rect")
                .attr("x",20 + 100 * i)
                .attr("y",20)
                .attr("width",10 + 10 * i)
                .attr("height",50)
                .style("fill", "lightgrey")
                .style("stroke","black")
                .style("stroke-width","3");
        }
    }
render() {
    return <div id="tuto"></div>
  }
}

export default Tuto;
